import './header.scss';
import logo from '../../Images/png/logo.png';
import MenuIcon from '@mui/icons-material/Menu';
import ClearIcon from '@mui/icons-material/Clear';
import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown';
import ArrowDropUpIcon from '@mui/icons-material/ArrowDropUp';
import userImage from '../../Images/whiteImg.svg';
import Cookies from 'universal-cookie';
import { useDispatch, useSelector } from 'react-redux';
import { USER_LOGOUT } from '../../redux/features/login';
import axios from '../../globals/common_utilities/axios_old';
import CONSTANTURL from '../../globals/common_utilities/constanturls';
import { API } from '../../globals/constants';

function Header() {
	const [clearIcon, setClearIcon] = useState(false);
	const [styleTraining, setStyleTraining] = useState(true);
	const [styleTrainingPartner, setStyleTrainingPartner] = useState(true);
	const [stylemore, setstylemore] = useState(true);
	const dispatch = useDispatch();
	const navigate = useNavigate();

	let activeStyle = {
		// textDecoration: 'underline',
		// color: 'red',
		fontWeight: 'bolder',
		fontSize: '10px',
	};

	const moreChangeStyle = () => {
		setstylemore(!stylemore);
	};

	const TrainingPartnerStyleChange = () => {
		setStyleTrainingPartner(!styleTrainingPartner);
	};

	const changeStyle = () => {
		setStyleTraining(!styleTraining);
	};
	const menuBar = () => {
		var x = document.getElementById('myTopnav');
		if (x.className === 'topnav') {
			x.className += ' responsive';
			setClearIcon(!clearIcon);
		} else {
			x.className = 'topnav';
			setClearIcon(!clearIcon);
		}
	};

	const cookies = new Cookies();

	const loginData = cookies.get('loginData');
	console.log('loginData', loginData);
	let userRole = loginData?.role_code;
	let userName = loginData?.name || '';
	let trimUserName = userName.substring(0, 15);

	const logout = () => {
		// cookies.set('loginData', 'undefined', { path: '/' });
		const logoutUser = async () => {
			const response = await axios(
				'GET',
				CONSTANTURL[process.env.REACT_APP_CUSTOM_ENV].LOGIN +
					API.END_POINTS.LOGOUT,
				{},
				{},
				{}
			)
				.then((response) => {
					navigate(APP_ROUTES.ROUTE_LOGIN);
					dispatch(USER_LOGOUT());
					cookies.remove('loginData', { path: '/' });
				})
				.catch((err) => {
					console.log('err::', err);
				});
		};
		logoutUser();
	};

	const dashBoardRedirct = () => {
		navigate(APP_ROUTES.ROUTE_ROOT);
	};

	const setHeader = (setUserRole) => {
		switch (setUserRole || '') {
			case 'SUPER_ADMIN':
