								</div>
							</div>
						</NavLink>
						{clearIcon ? (
							<div className="hideProfile">
								<div class="dropdown">
									<span
										className="fs-7"
										//  onClick={() => moreChangeStyle()}
									>
										{trimUserName}
									</span>
									<div className="dropdown-content">
										<NavLink
											className="fs-8"
											onClick={() => {
												menuBar();
												logout();
											}}
											// to={APP_ROUTES.FEEDBACK_LISTING}
										>
											Logout
										</NavLink>
									</div>
								</div>

								<img
									src={userImage}
									alt="ProfileIcon"
									className="profileImgDetails"
								/>
							</div>
						) : (
							''
						)}
					</div>
				);
			default:
				break;
		}
	};

	return (
		<>
			<div class="topnav" id="myTopnav">
				{setHeader(userRole)}
				<div className="profileDetails ">
					<div class="dropdown">
						<span className="fs-7">{trimUserName}</span>
						<div className="dropdown-content">
							<NavLink
								className="fs-8"
								onClick={() => {
									menuBar();
									logout();
								}}
							>
								Logout
							</NavLink>
						</div>
					</div>
					<img
						src={userImage}
						alt="ProfileIcon"
						className="profileImgDetails"
					/>
				</div>
				<div className="responsive">
					<div className="icon" onClick={menuBar}>
						{clearIcon ? <ClearIcon /> : <MenuIcon />}
					</div>
				</div>
			</div>
		</>
	);
}

export default Header;
